import { Cookies } from 'react-cookie';

const cookies = new Cookies();
const name = "secret"

export const setSecretCookie = (value: string, options?: any) => {
 	return cookies.set(name, value, {...options}); 
}

export const getSecretCookie = () => {
 return cookies.get(name); 
}
